import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './EventsPage.css';
import logo from "../assets/images/BookTown.png";

const EventsPage = () => {
  const [isFormVisible, setFormVisible] = useState(false);
  const [events, setEvents] = useState([]);
  const [formData, setFormData] = useState({
    eventName: '',
    eventDescription: '',
    eventLocation: '',
    date: '',
    timings: ''
  });

  // Fetch events from the backend
  useEffect(() => {
    axios.get('http://localhost:5000/api/events')
      .then(response => setEvents(response.data))
      .catch(error => console.error('Error fetching events:', error));
  }, []);

  // Handle input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle form submission
  const handleFormSubmit = (e) => {
    e.preventDefault();

    axios.post('http://localhost:5000/api/events', formData)
      .then(response => {
        // Add the new event to the list and reset the form
        setEvents([...events, {
          eventName: formData.eventName,
          eventDescription: formData.eventDescription,
          date: formData.date,
          timings: formData.timings,
          eventLocation: formData.eventLocation
        }]);
        setFormData({ eventName: '', eventDescription: '', eventLocation: '', date: '', timings: '' });
        setFormVisible(false); // Hide the form after submission
      })
      .catch(error => console.error('Error adding event:', error));
  };

  return (
    <div className="events-page">
      {/* Navbar */}
      <nav className="navbar">
        <img src={logo} alt="Logo" className="logo" />
        <button className="upload-event-button" onClick={() => setFormVisible(!isFormVisible)}>
          {isFormVisible ? 'Close Form' : 'Upload Event'}
        </button>
        {isFormVisible && (
          <form className="event-form" onSubmit={handleFormSubmit}>
            <input
              type="text"
              name="eventName"
              placeholder="Event Name"
              value={formData.eventName}
              onChange={handleInputChange}
              required
            />
            <input
              type="text"
              name="eventDescription"
              placeholder="Event Description"
              value={formData.eventDescription}
              onChange={handleInputChange}
              required
            />
            <input
              type="text"
              name="eventLocation"
              placeholder="Event Location"
              value={formData.eventLocation}
              onChange={handleInputChange}
              required
            />
            <input
              type="date"
              name="date"
              placeholder="Event Date"
              value={formData.date}
              onChange={handleInputChange}
              required
            />
            <input
              type="text"
              name="timings"
              placeholder="Event Timings"
              value={formData.timings}
              onChange={handleInputChange}
              required
            />
            <button type="submit">Submit</button>
          </form>
        )}
      </nav>

      {/* Events Heading */}
      <h1 className="events-heading">Events</h1>

      {/* Event Cards */}
      <div className="event-cards">
        {events.map((event, index) => (
          <div className="event-card" key={index}>
            <h3>{event.eventName}</h3> {/* Event Name */}
            <p><strong>Description:</strong> {event.eventDescription}</p> {/* Event Description */}
            <p><strong>Date:</strong> {new Date(event.date).toLocaleDateString()}</p> {/* Event Date */}
            <p><strong>Timings:</strong> {event.timings}</p> {/* Event Timings */}
            <p><strong>Location:</strong> {event.eventLocation}</p> {/* Event Location */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default EventsPage;
